#include <string>
using namespace std;

int main() {
    string input;
    getline(cin, input);

    for (int i=0; i < input.length(); i++)
        {
            char check = input[i];
            if(isspace(check)){
                continue;
            }
        }
        if (isalpha(check))
        {
            cout << check " is a letter!" << endl;
        }
        else if (isdigit(check))
        {
            cout << check << " is a digit!" << endl;
        }
        else
        {
            cout << check << " is a punctuation character!" << endl;
        }
    return 0;
}

